DROP TABLE IF EXISTS `movcom_bicitrayectos`;

CREATE TABLE `movcom_bicitrayectos` (
  `bicitrayecto_id` int(11) NOT NULL AUTO_INCREMENT,
  `bicitrayecto_inicio_fecha` date NOT NULL,
  `bicitrayecto_inicio_hora` time NOT NULL,
  `bicitrayecto_inicio_latitud` varchar(255) NOT NULL,
  `bicitrayecto_inicio_longitud` varchar(255) NOT NULL,
  `bicitrayecto_destino_fecha` date NOT NULL,
  `bicitrayecto_destino_hora` time NOT NULL,
  `bicitrayecto_destino_latitud` varchar(255) NOT NULL,
  `bicitrayecto_destino_longitud` varchar(255) NOT NULL,
  `bicitrayecto_metros` int(11) DEFAULT NULL,
  `usuario_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`bicitrayecto_id`),
  UNIQUE KEY `bicitrayecto_id` (`bicitrayecto_id`),
  UNIQUE KEY `bicitrayecto_usuario` (`bicitrayecto_id`,`usuario_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;

