UNLOCK TABLES;
--
-- Table structure for table `movcom_usuarios`
--
DROP TABLE IF EXISTS `movcom_usuarios`;
CREATE TABLE `movcom_usuarios` (
  `usuario_id` int(11) NOT NULL AUTO_INCREMENT,
  `usuario_cedula` int(11) DEFAULT NULL,
  `usuario_estado` tinyint(1) NOT NULL,
  `usuario_nombre` varchar(120) DEFAULT NULL,
  `usuario_celular` varchar(13) DEFAULT NULL,
  `usuario_correo` varchar(40) NOT NULL,
  `usuario_foto` mediumblob,
  `entidad_id` int(11) NOT NULL,
  PRIMARY KEY (`usuario_id`),
  UNIQUE KEY `usuario_id` (`usuario_id`),
  KEY `entidad_id` (`entidad_id`),
  CONSTRAINT `movcom_usuarios_ibfk_1` FOREIGN KEY (`entidad_id`) REFERENCES `movcom_entidades` (`entidad_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;


--
-- Table structure for table `movcom_rutas`
--
DROP TABLE IF EXISTS `movcom_rutas`;
CREATE TABLE `movcom_rutas` (
  `ruta_id` int(11) NOT NULL AUTO_INCREMENT,
  `ruta_inicio_direccion` varchar(255) NOT NULL,
  `ruta_inicio_latitud` varchar(255) NOT NULL,
  `ruta_inicio_longitud` varchar(255) NOT NULL,
  `ruta_destino_direccion` varchar(255) NOT NULL,
  `ruta_destino_latitud` varchar(255) NOT NULL,
  `ruta_destino_longitud` varchar(255) NOT NULL,
  `ruta_nombre` varchar(60) NOT NULL,
  `vehiculo_id` int(11) DEFAULT NULL,
  `ruta_cupo` int(11) DEFAULT NULL,
  `ruta_actual_latitud` varchar(255) DEFAULT NULL,
  `ruta_actual_longitud` varchar(255) DEFAULT NULL,
  `ruta_estado` int(11) DEFAULT NULL,
  PRIMARY KEY (`ruta_id`),
  UNIQUE KEY `ruta_id` (`ruta_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;
--
-- Table structure for table `movcom_puntos_rutas`
--
DROP TABLE IF EXISTS `movcom_puntos_rutas`;
CREATE TABLE `movcom_puntos_rutas` (
  `punto_id` int(11) NOT NULL AUTO_INCREMENT,
  `punto_latitud` varchar(255) NOT NULL,
  `punto_longitud` varchar(255) NOT NULL,
  `punto_direccion` varchar(80) NOT NULL,
  `ruta_id` int(11) NOT NULL,
  PRIMARY KEY (`punto_id`),
  UNIQUE KEY `punto_id` (`punto_id`),
  KEY `ruta_id` (`ruta_id`),
  CONSTRAINT `movcom_puntos_rutas_ibfk_1` FOREIGN KEY (`ruta_id`) REFERENCES `movcom_rutas` (`ruta_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;
--
-- Table structure for table `movcom_registros`
--
DROP TABLE IF EXISTS `movcom_registros`;
CREATE TABLE `movcom_registros` (
  `registro_id` int(11) NOT NULL AUTO_INCREMENT,
  `registro_fecha` date NOT NULL,
  `registro_hora` time NOT NULL,
  `registro_estado` tinyint(1) NOT NULL,
  `ruta_id` int(11) NOT NULL,
  PRIMARY KEY (`registro_id`),
  UNIQUE KEY `registro_id` (`registro_id`),
  KEY `ruta_id` (`ruta_id`),
  CONSTRAINT `movcom_registros_ibfk_1` FOREIGN KEY (`ruta_id`) REFERENCES `movcom_rutas` (`ruta_id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

--
-- Table structure for table `movcom_sitios_favoritos`
--
DROP TABLE IF EXISTS `movcom_sitios_favoritos`;
CREATE TABLE `movcom_sitios_favoritos` (
  `sitio_id` int(11) NOT NULL AUTO_INCREMENT,
  `sitio_nombre` varchar(30) NOT NULL,
  `sitio_descripcion` varchar(30) DEFAULT NULL,
  `sitio_latitud` varchar(255) NOT NULL,
  `sitio_longitud` varchar(255) NOT NULL,
  `sitio_direccion` varchar(80) NOT NULL,
  `usuario_id` int(11) NOT NULL,
  PRIMARY KEY (`sitio_id`),
  UNIQUE KEY `sitio_id` (`sitio_id`),
  KEY `usuario_id` (`usuario_id`),
  CONSTRAINT `movcom_sitios_favoritos_ibfk_1` FOREIGN KEY (`usuario_id`) REFERENCES `movcom_usuarios` (`usuario_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;

--
-- Table structure for table `movcom_suscripcion_ruta`
--
DROP TABLE IF EXISTS `movcom_suscripcion_ruta`;
CREATE TABLE `movcom_suscripcion_ruta` (
  `suscripcion_id` int(11) NOT NULL AUTO_INCREMENT,
  `usuario_id` int(11) NOT NULL,
  `ruta_id` int(11) NOT NULL,
  `suscripcion_propietario` tinyint(1) DEFAULT NULL,
  `suscripcion_inicio_latitud` varchar(255) DEFAULT NULL,
  `suscripcion_inicio_longitud` varchar(255) DEFAULT NULL,
  `suscripcion_activo` tinyint(1) DEFAULT NULL,
  `movcom_suscripcion_rutacol` varchar(45) DEFAULT NULL,
  `suscripcion_destino_latitud` varchar(255) DEFAULT NULL,
  `suscripcion_destino_longitud` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`suscripcion_id`),
  UNIQUE KEY `suscripcion_id` (`suscripcion_id`),
  KEY `usuario_id` (`usuario_id`),
  KEY `ruta_id` (`ruta_id`),
  CONSTRAINT `movcom_suscripcion_ruta_ibfk_1` FOREIGN KEY (`usuario_id`) REFERENCES `movcom_usuarios` (`usuario_id`),
  CONSTRAINT `movcom_suscripcion_ruta_ibfk_2` FOREIGN KEY (`ruta_id`) REFERENCES `movcom_rutas` (`ruta_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=latin1;  

--
-- Table structure for table `movcom_trayectos`
--
DROP TABLE IF EXISTS `movcom_trayectos`;
CREATE TABLE `movcom_trayectos` (
  `trayecto_id` int(11) NOT NULL AUTO_INCREMENT,
  `trayecto_inicio_fecha` date NOT NULL,
  `trayecto_inicio_hora` time NOT NULL,
  `trayecto_inicio_direccion` varchar(255) NOT NULL,
